import React from 'react'
import img1 from './images/img1.jpg';
import './Home.css';
function Home() {
    return (
        <>
            <div className='img'>
                <img src={img1} alt="" />
                <div className='intro'>

                </div>
               
            </div>

        </>
    )
}

export default Home
